--  テーブル hosplistdb.contact の構造をダンプしています
DROP TABLE IF EXISTS `contact`;
CREATE TABLE IF NOT EXISTS `contact` (
  `con_cd` int NOT NULL AUTO_INCREMENT COMMENT 'con_cd★主キー',
  `hos_cd` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT '' COMMENT '医療機関CD',
  `hos_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '医療機関名',
  `year` year DEFAULT NULL COMMENT '年度',
  `ins` int NOT NULL DEFAULT '0' COMMENT '施設区分',
  `date` date DEFAULT NULL COMMENT '日付',
  `method` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '方法',
  `ex_dept` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '連携機関対応者部署',
  `ex_position` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '連携機関対応者役職',
  `ex_name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '連携機関対応者氏名',
  `ex_subnames` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '連携機関対応人数・氏名',
  `in_dept` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '当院対応者所属',
  `in_name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '当院対応者氏名',
  `in_subnames` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '当院対応人数・氏名',
  `detail` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '内容',
  `con_note` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '備考',
  `data_dept` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'データ作成部署',
  PRIMARY KEY (`con_cd`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4780 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='コンタクト履歴（編集不可→delete_flgなし）';

